    public List MergeList(List a, List b)
    {
        List ret = new LinkedList();

        for(int i=0; i<a.size(); i++)
            ret.add(a.get(i));

        for(int i=0; i<b.size(); i++)
            ret.add(b.get(i));

        return ret;
    }

